import{_ as o,c as t,j as a,a as l,G as i,a8 as n,B as h,o as d}from"./chunks/framework.BDnHobkS.js";const _=JSON.parse('{"title":"PX4-Autopilot Головна нотатка щодо релізу","description":"","frontmatter":{},"headers":[],"relativePath":"uk/releases/main.md","filePath":"uk/releases/main.md"}'),s={name:"uk/releases/main.md"};function u(m,e,c,f,p,b){const r=h("Badge");return d(),t("div",null,[e[0]||(e[0]=a("h1",{id:"px4-autopilot-головна-нотатка-щодо-релізу",tabindex:"-1"},[l("PX4-Autopilot Головна нотатка щодо релізу "),a("a",{class:"header-anchor",href:"#px4-autopilot-головна-нотатка-щодо-релізу","aria-label":'Permalink to "PX4-Autopilot Головна нотатка щодо релізу"'},"​")],-1)),i(r,{type:"danger",text:"Alpha"}),e[1]||(e[1]=n('<p>This contains changes to PX4 <code>main</code> branch since the last major release (<a href="./../releases/1.15.html">PX v1.15</a>).</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The PX4 v1.15 release is in beta testing, pending release. Update these notes with features that are going to be in <code>main</code> but not the PX4 v1.15 release.</p></div><h2 id="прочитаите-перед-оновленням" tabindex="-1">Прочитайте перед оновленням <a class="header-anchor" href="#прочитаите-перед-оновленням" aria-label="Permalink to &quot;Прочитайте перед оновленням&quot;">​</a></h2><p>TBD …</p><p>Please continue reading for <a href="#upgrade-guide">upgrade instructions</a>.</p><h2 id="основні-зміни" tabindex="-1">Основні зміни <a class="header-anchor" href="#основні-зміни" aria-label="Permalink to &quot;Основні зміни&quot;">​</a></h2><ul><li>Уточнюється</li></ul><h2 id="інструкціі-для-оновлення" tabindex="-1">Інструкції для оновлення <a class="header-anchor" href="#інструкціі-для-оновлення" aria-label="Permalink to &quot;Інструкції для оновлення&quot;">​</a></h2><h2 id="інші-зміни" tabindex="-1">Інші зміни <a class="header-anchor" href="#інші-зміни" aria-label="Permalink to &quot;Інші зміни&quot;">​</a></h2><h3 id="підтримка-обладнання" tabindex="-1">Підтримка обладнання <a class="header-anchor" href="#підтримка-обладнання" aria-label="Permalink to &quot;Підтримка обладнання&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="загальні" tabindex="-1">Загальні <a class="header-anchor" href="#загальні" aria-label="Permalink to &quot;Загальні&quot;">​</a></h3><ul><li><a href="./../config/battery.html">Battery level estimation improvements</a> (<a href="https://github.com/PX4/PX4-Autopilot/pull/23205" target="_blank" rel="noreferrer">PX4-Autopilot#23205</a>). <ul><li><a href="./../config/battery.html#voltage-based-estimation-with-load-compensation">Voltage-based estimation with load compensation</a> now uses a real-time estimate of the internal resistance of the battery to compensate voltage drops under load (with increased current), providing a better capacity estimate than with the raw measured voltage.</li><li>Thrust-based load compensation has been removed (along with the <code>BATn_V_LOAD_DROP</code> parameters, where <code>n</code> is the battery number).</li></ul></li></ul><h3 id="управління" tabindex="-1">Управління <a class="header-anchor" href="#управління" aria-label="Permalink to &quot;Управління&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="оцінки" tabindex="-1">Оцінки <a class="header-anchor" href="#оцінки" aria-label="Permalink to &quot;Оцінки&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="датчики" tabindex="-1">Датчики <a class="header-anchor" href="#датчики" aria-label="Permalink to &quot;Датчики&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="симуляція" tabindex="-1">Симуляція <a class="header-anchor" href="#симуляція" aria-label="Permalink to &quot;Симуляція&quot;">​</a></h3><ul><li>[SIH]: The SIH on SITL <a href="./../sim_sih/#set-custom-takeoff-location">custom takeoff location</a> in now set using the normal unscaled GPS position values, where previously the value needed to be multiplied by 1E7. (<a href="https://github.com/PX4/PX4-Autopilot/pull/23363" target="_blank" rel="noreferrer">PX4-Autopilot#23363</a>).</li><li>[Gazebo]: <ul><li>Gazebo Harmonic LTS release replaces Gazebo Garden as the version supported by PX4. The default installer scripts (used for CI) and documentation have been updated. This is required because Garden end-of-life is Nov 2024. (<a href="https://github.com/PX4/PX4-Autopilot/pull/23603" target="_blank" rel="noreferrer">PX4-Autopilot#23603</a>)</li><li>New vehicle model <code>x500_lidar_2d</code> — <a href="./../sim_gazebo_gz/vehicles.html#x500-quadrotor-with-2d-lidar">x500 Quadrotor with 2D Lidar</a>. (<a href="https://github.com/PX4/PX4-Autopilot/pull/22418" target="_blank" rel="noreferrer">PX4-Autopilot#22418</a>, <a href="https://github.com/PX4/PX4-gazebo-models/pull/41" target="_blank" rel="noreferrer">PX4-gazebo-models#41</a>).</li><li>New vehicle model <code>x500_lidar_front</code> — <a href="./../sim_gazebo_gz/vehicles.html#x500-quadrotor-with-1d-lidar-front-facing">X500 Quadrotor with 1D LIDAR (Front-facing)</a>. (<a href="https://github.com/PX4/PX4-Autopilot/pull/23879" target="_blank" rel="noreferrer">PX4-Autopilot#23879</a>, <a href="https://github.com/PX4/PX4-gazebo-models/pull/62/files" target="_blank" rel="noreferrer">PX4-gazebo-models#62</a>).</li><li>New vehicle model <code>x500_lidar_down</code> — <a href="./../sim_gazebo_gz/vehicles.html#x500-quadrotor-with-1d-lidar-down-facing">X500 Quadrotor with 1D LIDAR (Down-facing)</a>. (<a href="https://github.com/PX4/PX4-Autopilot/pull/23879" target="_blank" rel="noreferrer">PX4-Autopilot#23879</a>, <a href="https://github.com/PX4/PX4-gazebo-models/pull/62/files" target="_blank" rel="noreferrer">PX4-gazebo-models#62</a>).</li><li>New vehicle model <code>r1_rover</code> — <a href="./../sim_gazebo_gz/vehicles.html#differential-rover">Aion Robotics R1 Rover</a> (<a href="https://github.com/PX4/PX4-Autopilot/pull/22402" target="_blank" rel="noreferrer">PX4-Autopilot#22402</a> and <a href="https://github.com/PX4/PX4-gazebo-models/pull/21" target="_blank" rel="noreferrer">PX4-gazebo-models#21</a>).</li><li>New vehicle model <code>rover_ackermann</code> — <a href="./../sim_gazebo_gz/vehicles.html#ackermann-rover">Ackermann Rover</a> (<a href="https://github.com/PX4/PX4-Autopilot/pull/23383" target="_blank" rel="noreferrer">PX4-Autopilot#23383</a> and <a href="https://github.com/PX4/PX4-gazebo-models/pull/46" target="_blank" rel="noreferrer">PX4-gazebo-models#46</a>).</li></ul></li></ul><h3 id="ethernet" tabindex="-1">Ethernet <a class="header-anchor" href="#ethernet" aria-label="Permalink to &quot;Ethernet&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="uxrce-dds-ros2" tabindex="-1">uXRCE-DDS / ROS2 <a class="header-anchor" href="#uxrce-dds-ros2" aria-label="Permalink to &quot;uXRCE-DDS / ROS2&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="mavlink" tabindex="-1">MAVLink <a class="header-anchor" href="#mavlink" aria-label="Permalink to &quot;MAVLink&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="мульти-ротор" tabindex="-1">Мульти-Ротор <a class="header-anchor" href="#мульти-ротор" aria-label="Permalink to &quot;Мульти-Ротор&quot;">​</a></h3><ul><li>Allow system-default <a href="./../flight_modes_mc/orbit.html">multicopter orbit mode</a> yaw behaviour to be configured, using the parameter <a href="./../advanced_config/parameter_reference.html#MC_ORBIT_YAW_MOD">MC_ORBIT_YAW_MOD</a> (<a href="https://github.com/PX4/PX4-Autopilot/pull/23358" target="_blank" rel="noreferrer">PX4-Autopilot#23358</a>)</li><li>Adapted the <a href="./../computer_vision/collision_prevention.html">Collision Prevention</a> implementation to work in the default manual flight mode (Acceleration Based) <a href="./../advanced_config/parameter_reference.html#MPC_POS_MODE">MPC_POS_MODE</a>. (<a href="https://github.com/PX4/PX4-Autopilot/pull/23507" target="_blank" rel="noreferrer">PX4-Autopilot#23507</a></li></ul><h3 id="vtol" tabindex="-1">VTOL <a class="header-anchor" href="#vtol" aria-label="Permalink to &quot;VTOL&quot;">​</a></h3><ul><li>Уточнюється</li></ul><h3 id="літак-з-фіксованим-крилом" tabindex="-1">Літак з фіксованим крилом <a class="header-anchor" href="#літак-з-фіксованим-крилом" aria-label="Permalink to &quot;Літак з фіксованим крилом&quot;">​</a></h3><ul><li>Improvement: Fixed-wing auto takeoff: enable setting takeoff flaps for hand/catapult launch. <a href="https://github.com/PX4/PX4-Autopilot/pull/23460" target="_blank" rel="noreferrer">PX4-Autopilot#23460</a></li></ul><h3 id="ровер" tabindex="-1">Ровер <a class="header-anchor" href="#ровер" aria-label="Permalink to &quot;Ровер&quot;">​</a></h3><p>This release contains a major rework for the rover support in PX4:</p><ul><li>Complete restructure of the <a href="./../frames_rover/">rover related documentation</a>.</li><li>New firmware build specifically for <a href="./../frames_rover/#flashing-the-rover-build">rovers</a>.</li><li>New module dedicated to <a href="./../frames_rover/ackermann.html">Ackermann rovers</a>: <ul><li>The module currently supports <a href="./../flight_modes_rover/ackermann.html#manual-mode">manual mode</a>, <a href="./../flight_modes_rover/ackermann.html#acro-mode">acro mode</a>, <a href="./../flight_modes_rover/ackermann.html#position-mode">position mode</a> and <a href="./../flight_modes_rover/ackermann.html#auto-modes">auto modes</a>.</li></ul></li><li>New module dedicated to <a href="./../frames_rover/differential.html">differential rovers</a>: <ul><li>The module currently supports <a href="./../flight_modes_rover/differential.html#manual-mode">manual mode</a>, <a href="./../flight_modes_rover/differential.html#acro-mode">acro mode</a>, <a href="./../flight_modes_rover/differential.html#stabilized-mode">stabilized mode</a>, <a href="./../flight_modes_rover/differential.html#position-mode">position mode</a> and <a href="./../flight_modes_rover/differential.html#auto-modes">auto modes</a>.</li></ul></li><li>New module dedicated to <a href="./../frames_rover/mecanum.html">mecanum rovers</a>: <ul><li>The module currently supports <a href="./../flight_modes_rover/mecanum.html#manual-mode">manual mode</a>, <a href="./../flight_modes_rover/mecanum.html#acro-mode">acro mode</a>, <a href="./../flight_modes_rover/mecanum.html#stabilized-mode">stabilized mode</a>, <a href="./../flight_modes_rover/mecanum.html#position-mode">position mode</a> and <a href="./../flight_modes_rover/mecanum.html#auto-modes">auto modes</a>.</li></ul></li><li>Restructure of the <a href="./../airframes/airframe_reference.html#rover">rover airframe</a> numbering convention (<a href="https://github.com/PX4/PX4-Autopilot/pull/23506" target="_blank" rel="noreferrer">PX4-Autopilot#23506</a>). This also introduces several <a href="./../airframes/airframe_reference.html#rover">new rover airframes</a>: <ul><li>Generic Differential Rover <code>50000</code>.</li><li>Generic Ackermann Rover <code>51000</code>.</li><li>Axial SCX10 2 Trail Honcho <code>51001</code>.</li><li>Generic Mecanum Rover <code>52000</code>.</li></ul></li><li>Library for the <a href="./../config_rover/differential.html#pure-pursuit-guidance-logic">pure pursuit guidance algorithm</a> that is shared by all the rover modules.</li><li><a href="./../frames_rover/#simulation">Simulation</a> for differential-steering and Ackermann rovers in gazebo (for release notes see <code>r1_rover</code> and <code>rover_ackermann</code> in <a href="#simulation">simulation</a>).</li><li>Deprecation of the <a href="./../frames_rover/rover_position_control.html">rover position control</a> module: Note that the legacy rover module still exists but has been superseded by the new dedicated modules.</li></ul><h3 id="ros-2" tabindex="-1">ROS 2 <a class="header-anchor" href="#ros-2" aria-label="Permalink to &quot;ROS 2&quot;">​</a></h3><ul><li>Уточнюється</li></ul>',38))])}const v=o(s,[["render",u]]);export{_ as __pageData,v as default};
